function Login(){
    return (
        <form>
            <div>
                <label htmlFor="login-username">Username <span>*</span></label>
                <input type="text" id="login-username"/>
            </div>
            <div>
                <label htmlFor="login-password">Password</label>
                <input type="text" id="login-password"/>
            </div>
        </form>
    )
}
export default Login;
